text:
taqiyaa in action 
iran has announced its endorsement of the #metoo movement, and has offered a solution to the problem of sexual assault that triggered it.

wait, that might not be the solution feminists are demanding.

nevertheless, the social media account for khamenei.ir has stated, “the disaster of countless sexual assaults on western women – including incidents leading to #metoo campaign – and islam’s proposal to revolve it…” included is a video that features images of #metoo marches and #metoo claims by women including celebrities.

among those is sen. elizabeth warren.

the solution?

the video explains, “by introducing the hijab, islam has shut the door on a path that would pull women towards such deviation." "khamenei’s ridiculous and condescending solution for the west’s #metoo movement was shredded on social media,” the report said.

for example, yitzhak santis wrote, “forcing women to wear hijab by law is fascistic and dictatorial. in iran women are arrested for refusing to wear hijab, or stoned to death for the ‘crime’ of adultry…” faranak amidi said, “u threaten women and jail them u oppress them and then salute yourself for not having any such protests?” #hypocrite #nosharia 
